import React from "react";
import Navbar from "../components/Navbar";
import "../styles/services.css";

function Services() {
  return (
    <div className="services-container">
      <Navbar />
      <h1>Our Services</h1>
      <p>We offer innovative knitwear development...</p>
    </div>
  );
}

export default Services;
